import styled from "styled-components";
import { Link } from "react-router-dom";

const StyledLink = styled(Link)`
  // font-size: 20px;
`;

let CuteButton = ({ children, to }) => {
  return <StyledLink to={to}>{children}</StyledLink>;
};

export default CuteButton;
